import React, { useEffect } from "react";
import { useState } from "react";
import BackToTop from "react-back-to-top";
import "../Backtotop/Backtotop.scss";

export default function Backtotop() {
  return (
    <BackToTop
      mainStyle={{
        width: "100%",
        height: "100%",
        backgroundColor: "#4590f6",
        borderRadius: "10px",

      }}
      percentStyle={{
        width: "100%",
        height: "100%",
        display: "none"
      }}
      animate="rotate"
      offsetTop={10}
      step={100}
      percent={true}
      visiblePercent={20}
      back-to-up-default-text={"Top"}
      
    />
  );
}
